import React from 'react'

const Person = ({ name, number }) => <div>{name} {number}</div>;


const Persons = ({ persons, pala }) => {
  return (
    <div>
      {persons.map(person =>
        <Person key={person.name} name={person.name} number={person.number} pala={pala} />)}
        <button>poista</button>
    </div>
  )
};

export default Persons;
